export default function Start() {

    return (
        <div id='titleScreen'>
            <p>Hello, I am</p>
            <h1 className='BLACKOUT'>tyra woden</h1>
            <p>I have a passion for creating <span className='green'>awesome</span> digital experiences.</p>
        </div>
    );
}
